import React from 'react';
import "./styles/navbar.css"; 

function navbar(){
    return (
        <nav className="navbar">
            <div className="logo"></div>
                <a href="/">
                    <img src="/" alt="orangeODC"></img>
                    </a>
        <div className="profile">
        <button>Profile</button>
        </div>

        </nav>
    )

}


export default navbar;
